import React from "react";
import "../styles/MedicalRecords.css";

const MedicalRecords = () => {
    return (
        <div className="medical-records">
            <h3>Medical Records</h3>
            <p>Blood Group: -</p>
            <p>Diet: -</p>
        </div>
    );
};

export default MedicalRecords;
